const tape = require("tape"),
      d3 = require("../");

function shuffle(arr){
  var m = arr.length, t, i;
  while (m) {
    i = Math.floor(Math.random() * m--);
    t = arr[m];
    arr[m] = arr[i];
    arr[i] = t;
  }
  return arr;
}

tape("log.domain(domain) sets the domain explicitly", function(test) {
  const r = d3.regressionLog().domain([0, 50]);
  test.deepEqual(r.domain(), [0, 50]);
  test.end();
});

tape("log.base(base) sets the base explicitly", function(test) {
  const r = d3.regressionLog().base(10);
  test.equal(r.base(), 10);
  test.end();
});

